(1) Contact the colleague who provided the image to confirm that qemu-guest-agent has been installed in the virtual machine (2) Modify the nova database to change the virtual machine field: MariaDB [(none)]> use nova;
MariaDB [nova]> insert into instance_system_metadata values(NULL,NULL,NULL,NULL,'2cf79497-d1ba-42c3-adf5-3b45c6927dfb','image_hw_qemu_guest_agent','yes',0);
注： 2cf79497-d1ba-42c3-adf5-3b45c6927dfb 为对应instance的uuid
检查：select * from instance_system_metadata where instance_uuid='3ce9d8b0-a0a3-48ed-ba54-415883f717e5'; (3) Modify the image used by the virtual machine # glance image-update xxx --property hw_qemu_guest_agent=yes --property hw_ovirt_guest_agent=yes (4) To hard restart the virtual machine, you need to contact the customer in advance # nova reboot 2cf79497-d1ba-42c3-adf5-3b45c6927dfb --hard --poll
